scriptlet.script:
try{
	String.prototype.lpad = function(padString, length) {
			var str = this;
			while (str.length < length)
					str = padString + str;
			return str;
	}
	str = packageFee;
	a = str.lpad("0", 12);

	scriptletContext.put("packageFee",a); 

	response = "success";

} catch(err) {
	errorMessage = 'An error occured while appending zeros to packageFee in step "Update FACT Screen Rule2 for day2" :' + err.message;
	scriptletContext.put("errorMessage", errorMessage);
	scriptletContext.put("failureFlag", "True");	
	response = "failure";
}

scriptletResponse = response;
